export const settings = {
  radius: "12px",
  shadow: {
    light: "5px 10px 50px 10px #888888",
    dark: "inset 0 0 10px #000000"
  },
  transition: "0.05s ease-in-out",
  transitionDelay: "1s"
};

export const colors = {
  BLACK: "#000",
  CHAPMAN_RED: "#A50034",
  DARK_SEA_GREEN: "#A1C97D",
  MUI_PRIMARY: "#757ce8",
  TEXT: "#616469"
};
